/*----- Creates a button -----*/
function createButton(id, onclick, cx, cy) {
    var button = document.createElementNS('http://www.w3.org/2000/svg', 'g');
    button.setAttributeNS(null, 'id', id);
    button.setAttributeNS(null, 'onclick', onclick);
    
    var circ = document.createElementNS('http://www.w3.org/2000/svg', 'circle');
    circ.setAttributeNS(null, 'cy', cy);
    circ.setAttributeNS(null, 'cx', cx);
    circ.setAttributeNS(null, 'r', buttonRadius);
    circ.setAttributeNS(null, 'fill', buttonColor);
    circ.setAttributeNS(null, 'opacity', '1');
    circ.setAttributeNS(null, 'stroke', 'none');
    
    button.appendChild(circ);
    
    return button;
}

/*----------------------------------------------------------------------------------*/

/*----- Creates a path used as buttonsymbol -----*/
function createButtonPath(startX, startY, d, opacity) {
    var path = document.createElementNS('http://www.w3.org/2000/svg', 'path');
    path.setAttributeNS(null, 'd',d);
    path.setAttributeNS(null, 'transform', 'translate('+startX+','+startY+')');
    path.setAttributeNS(null, 'fill', 'white');
    path.setAttributeNS(null, 'stroke', 'none');
    path.setAttributeNS(null, 'opacity', opacity);
    
    return path;
}

/*----------------------------------------------------------------------------------*/

/*----- Creates an animate element needed for animations -----*/
function createAnimateElement(id, href, attributeName, from, to, alt_duration) {
    var animateElement = document.createElementNS("http://www.w3.org/2000/svg", "animate");

    animateElement.setAttributeNS(null, 'id', '' + id);
    animateElement.setAttributeNS('http://www.w3.org/1999/xlink', 'href', '#' + href);
    animateElement.setAttributeNS(null, 'attributeName', '' + attributeName);
    animateElement.setAttributeNS(null, 'from', '' + from);
    animateElement.setAttributeNS(null, 'to', '' + to);
    animateElement.setAttributeNS(null, 'dur', '' + duration);
    animateElement.setAttributeNS(null, 'fill', 'freeze');
    animateElement.setAttributeNS(null, 'begin', 'undefined');

    document.documentElement.appendChild(animateElement);
    animateElements.push(animateElement);

    return animateElement;
}

/*----- Creates an animateTransform element needed for animations -----*/
function createAnimateTransformElement(id, href, type, attributeName, from, to, additive, alt_duration) {
    var animateTransformElement = document.createElementNS("http://www.w3.org/2000/svg", "animateTransform");

    animateTransformElement.setAttributeNS(null, 'id', '' + id);
    animateTransformElement.setAttributeNS('http://www.w3.org/1999/xlink', 'href', '#' + href);
    animateTransformElement.setAttributeNS(null, 'type', '' + type);
    animateTransformElement.setAttributeNS(null, 'attributeName', '' + attributeName);
    animateTransformElement.setAttributeNS(null, 'from', '' + from);
    animateTransformElement.setAttributeNS(null, 'to', '' + to);
    animateTransformElement.setAttributeNS(null, 'additive', '' + additive);
    animateTransformElement.setAttributeNS(null, 'dur', '' + duration);
    animateTransformElement.setAttributeNS(null, 'fill', 'freeze');
    animateTransformElement.setAttributeNS(null, 'begin', 'undefined');

    document.documentElement.appendChild(animateTransformElement);
    animateElements.push(animateTransformElement);

    return animateTransformElement;
}

