/*----- initialize controls -----*/
function initControls(evt){
    document = evt.target.ownerDocument;
    noOfGraphs = parseFloat(document.documentElement.getAttributeNS(null, 'class'));
    
    document.getElementsByTagName("g").item(0).setAttributeNS(null, 'transform', 'translate(0,100)');
    var docWidth = document.documentElement.getAttributeNS(null, 'width');
    var docHeight = document.documentElement.getAttributeNS(null, 'height');
    
    var docWidth = parseFloat(docWidth);
    
    if(docWidth < 700){
        document.documentElement.setAttributeNS(null, 'width', 700);
        docWidth = 700;
    }
   
    createBar(docHeight, docWidth);
    createButtons(docWidth);
    createTextField(docWidth);
    createSliders(docWidth);
    
    if(noOfGraphs > 1){
        createGraphSlider(docWidth);
    }
    
    createCheckbox(docWidth/2 + xHighlightEdges, yHighlightEdges, 'highlightingBox', 'highlight edges', 'uncheckHighlighting(evt)', 'highlightingCross', 1);
    createCheckbox(docWidth/2 + xLoop, yLoop, 'loopBox', 'loop animation', 'uncheckLoop(evt)', 'loopCross', 0);
    createInputField(docWidth);
    insertVisone();
    
    if(noOfGraphs <= 1){
        changeButtonColor(false, true);
    }
}

