function createBar(docHeight, docWidth){
    var newHeight = parseFloat(docHeight) + 100;
    document.documentElement.setAttributeNS(null, 'height', newHeight);
    
    var bar = document.createElementNS('http://www.w3.org/2000/svg', 'rect');
    bar.setAttributeNS(null, 'height' , '100');
    bar.setAttributeNS(null, 'width', docWidth);
    bar.setAttributeNS(null, 'stroke', 'none');
    bar.setAttributeNS(null, 'fill', barColor);
    bar.setAttributeNS(null, 'y', '0'); 
    document.documentElement.appendChild(bar);
}

