/*----- Creates Buttons -----*/
function createButtons(width){
	var xCoordinate = parseFloat(width)/2 + xPlayPrevNext;
	
	var group = document.createElementNS('http://www.w3.org/2000/svg', 'g');
	group.setAttributeNS(null, 'transform', 'translate('+xCoordinate+','+yPlayPrevNext+')');
    
	var xCircle = 0;
    var playButton = createButton('playButton', 'play(evt)', xCircle, 0);
    
    var startX = xCircle + 9.5;
    var playPath = createButtonPath(startX, 0, playD, '1');
    
    startX = xCircle + 8;
    var startY = 8;
    var stopPath = createButtonPath(startX, startY, stopD, '0');
    playButton.appendChild(playPath);
    playButton.appendChild(stopPath);
    
    xCircle = xCircle + 35;
    var nextButton = createButton('nextButton', 'next(evt)', xCircle, 0);
    
    startX = xCircle + 2;
    var nextPath = createButtonPath(startX, 0, nextD, '1'); 
    nextButton.appendChild(nextPath);
    
    xCircle = xCircle - 70;
    var prevButton = createButton('prevButton', 'previous(evt)', xCircle, 0);
    
    startX = xCircle - 10;
    var prevPath = createButtonPath(startX, 0, prevD, '1');
    prevButton.appendChild(prevPath);
    
    group.appendChild(playButton);
    group.appendChild(nextButton);
    group.appendChild(prevButton);
    document.documentElement.appendChild(group);
}

/*----------------------------------------------------------------------------------*/

/*----- Creates speed- and duration-slider -----*/
function createSliders(width){
    var xCoordinate = parseFloat(width)/2;
    
    var speedSlider = createSlider('speedSlider', xCoordinate+xSpeedSlider, ySpeedSlider, sliderLineD, sliderStrokesD, 81, 0);
    var slow = createTextNode(-13, 35, 'none', font, '14px', 'slow');
    var fast = createTextNode(133, 35, 'none', font, '14px', 'fast');
    var speed = createTextNode(-45, 10, 'none', font, '14px', 'speed');
      
    speedSlider.appendChild(slow);
    speedSlider.appendChild(fast);
    speedSlider.appendChild(speed);
    speedSlider.addEventListener('mousedown', sliderActivate, false);
    speedSlider.addEventListener('mouseup', sliderDeactivate, false);
    
    var delaySlider = createSlider('delaySlider', xCoordinate+xDelaySlider, yDelaySlider, sliderLineD, sliderStrokesD, 0, 0);
    var low = createTextNode(-13, 35, 'none', font, '14px', 'low');
    var high = createTextNode(133, 35, 'none', font, '14px', 'high');
    var delay = createTextNode(-45, 10, 'none', font, '14px', 'delay');
    
    delaySlider.appendChild(low);
    delaySlider.appendChild(high);
    delaySlider.appendChild(delay);
    delaySlider.addEventListener('mousedown', sliderActivate, false);
    delaySlider.addEventListener('mouseup', sliderDeactivate, false);
    
    document.documentElement.appendChild(speedSlider);
    document.documentElement.appendChild(delaySlider);
}

/*----------------------------------------------------------------------------------*/

/*----- creates the graph-slider -----*/
function createGraphSlider(width){
    var x = parseFloat(width)/2 + xGraphSlider;
    
    var strokes = graphSliderStrokesBegin+' ';
    graphSliderStep = graphSliderLength/(noOfGraphs - 1);
    
    for(var i=1; i<noOfGraphs; i++){
        var nextStroke = i*graphSliderStep;
        strokes += 'M'+nextStroke+','+graphStrokeLength+' '+nextStroke+',0 ';
    }
    
    var graphSlider = createSlider('graphSlider', x, yGraphSlider, graphSliderLine, strokes, 0, -10);
    graphThumb = graphSlider.childNodes[3];
    graphSlider.addEventListener('mousedown', sliderActivate, false);
    graphSlider.addEventListener('mouseup', sliderDeactivate, false);
    document.documentElement.appendChild(graphSlider);
}

/*----------------------------------------------------------------------------------*/

/*----- creates a slider -----*/
function createSlider(id, xCoordinate, yCoordinate, line, strokes, defaultThumbPos, yCoordinateThumb){
    var slider = document.createElementNS('http://www.w3.org/2000/svg', 'g');
    slider.setAttributeNS(null, 'id', id);
    slider.setAttributeNS(null, 'transform', 'translate('+xCoordinate+','+yCoordinate+')');
    slider.setAttributeNS(null, 'xoffset', xCoordinate);
    
    var boundingBox = document.createElementNS('http://www.w3.org/2000/svg', 'rect');
    boundingBox.setAttributeNS(null, 'x', -10);
    boundingBox.setAttributeNS(null, 'y', -10);
    boundingBox.setAttributeNS(null, 'height', '40');
    boundingBox.setAttributeNS(null, 'width', '165');
    boundingBox.setAttributeNS(null, 'fill', 'black');
    boundingBox.setAttributeNS(null, 'opacity', '0');
    //boundingBox.setAttributeNS(null, 'onmouseout', 'sliderDeactivate(evt)');
    
    var sliderLine = document.createElementNS('http://www.w3.org/2000/svg', 'path');
    sliderLine.setAttributeNS(null, 'd', line);
    sliderLine.setAttributeNS(null, 'stroke-width', '2');
    
    var sliderStrokes = document.createElementNS('http://www.w3.org/2000/svg', 'path');
    sliderStrokes.setAttributeNS(null, 'd', strokes);
    sliderStrokes.setAttributeNS(null, 'stroke', 'black');
    sliderStrokes.setAttributeNS(null, 'fill', 'none');
    
    var thumb = document.createElementNS('http://www.w3.org/2000/svg', 'g');
    thumb.setAttributeNS(null, 'id', id+'.Thumb');
    thumb.setAttributeNS(null, 'transform', 'translate('+defaultThumbPos+','+yCoordinateThumb+')');
    
    var thumbPath = document.createElementNS('http://www.w3.org/2000/svg', 'path');
    thumbPath.setAttributeNS(null, 'd', thumbD);
    thumbPath.setAttributeNS(null, 'fill', thumbColor);
    thumbPath.setAttributeNS(null, 'stroke', thumbStroke);
    
    thumb.appendChild(thumbPath);
    slider.appendChild(boundingBox);
    slider.appendChild(sliderLine);
    slider.appendChild(sliderStrokes);
    slider.appendChild(thumb);
    
    return slider;
}

