function createCheckbox(x, y, id, text, func, crossId, opacity){
    var checkbox = document.createElementNS('http://www.w3.org/2000/svg', 'g');
    checkbox.setAttributeNS(null, 'id', id);
    checkbox.setAttributeNS(null, 'transform', 'translate('+x+','+y+')');
    
    var text = createTextNode(20, 11, 'none', font, '14px', text);
    
    var box = document.createElementNS('http://www.w3.org/2000/svg', 'rect');
    box.setAttributeNS(null, 'x', 0);
    box.setAttributeNS(null, 'y', 0);
    box.setAttributeNS(null, 'height', '15');
    box.setAttributeNS(null, 'width', '15');
    box.setAttributeNS(null, 'fill', 'white');
    box.setAttributeNS(null, 'opacity', '1');
    box.setAttributeNS(null, 'stroke', 'none');
    box.setAttributeNS(null, 'onclick', func);
    
    var cross = document.createElementNS('http://www.w3.org/2000/svg', 'path');
    cross.setAttributeNS(null, 'd', 'M2,2 L13,13 M2,13 L13,2');
    cross.setAttributeNS(null, 'fill', 'none');
    cross.setAttributeNS(null, 'stroke', 'black');
    cross.setAttributeNS(null, 'opacity', opacity);
    cross.setAttributeNS(null, 'id', 'highlightCross');
    cross.setAttributeNS(null, 'onclick', 'uncheckHighlighting(evt)');
    cross.setAttributeNS(null, 'id', crossId);
    
    
    checkbox.appendChild(box);
    checkbox.appendChild(text);
    checkbox.appendChild(cross);
    
    document.documentElement.appendChild(checkbox);
}

