/*----- creates a text field, that shows the number of the shown graph -----*/
function createTextField(width){
    var y = yNoOfGraphsField;
    var x = parseFloat(width)/2 + xNoOfGraphsField;
    var text = createTextNode(x, y, 'none', font, '16px', '1/'+noOfGraphs);

    text.setAttributeNS(null, 'id', 'textField');
    document.documentElement.appendChild(text);
}

