/*----- creates a TextNode -----*/
function createTextNode(x, y, stroke, font, fontsize, text){
    var textElem = document.createElementNS('http://www.w3.org/2000/svg', 'text');
    textElem.setAttributeNS(null, 'x', x);
    textElem.setAttributeNS(null, 'y', y);
    textElem.setAttributeNS(null, 'stroke', stroke);
    textElem.setAttributeNS(null, 'font-family', font);
    textElem.setAttributeNS(null, 'font-size', fontsize);
    textElem.setAttributeNS(null, 'pointer-events', 'none');
    
    var textNode = document.createTextNode(text);
    textElem.appendChild(textNode);
    
    return textElem;
}

