/*----- creates an input with button -----*/
function createInputField(width){
    var x = parseFloat(width)/2 + xJumpTo;
    var y = yJumpTo;
    var rectWidth = 60;
    var rectHeight = 25;
    var input = createInputNode(x, y);
    x += -60;
    y += 7;
    var button = createJumpButton('jumpButton', 'jumpToEvent(evt)', x, y, rectWidth, rectHeight);
    
    document.documentElement.appendChild(button);
    document.documentElement.appendChild(input);
}

