/*----- creates a input as foreignObject -----*/
function createInputNode(x, y){
    var foreignElem = document.createElementNS('http://www.w3.org/2000/svg', 'foreignObject');
    foreignElem.setAttributeNS(null, 'x', x);
    foreignElem.setAttributeNS(null, 'y', y);
    foreignElem.setAttributeNS(null, 'width', '50');
    foreignElem.setAttributeNS(null, 'height', '50');
    
    var bodyElem = document.createElementNS('http://www.w3.org/1999/xhtml', 'body');
    bodyElem.setAttribute('xmlns', 'http://www.w3.org/1999/xhtml');
    bodyElem.setAttributeNS(null, 'style', 'position:fixed;');
    
    var inputElem = document.createElementNS('http://www.w3.org/1999/xhtml', 'input');
    inputElem.setAttributeNS(null, 'type', 'text');
    inputElem.setAttributeNS(null, 'size', '2');
    inputElem.setAttributeNS(null, 'id', 'inputField');

    bodyElem.appendChild(inputElem);
    foreignElem.appendChild(bodyElem);
    
    return foreignElem;   
}

