/*----- creates jump-button -----*/
function createJumpButton(id, onclick, x, y, width, height) {
    var button = document.createElementNS('http://www.w3.org/2000/svg', 'g');
    button.setAttributeNS(null, 'id', id);
    button.setAttributeNS(null, 'onclick', onclick);
    
    var rect = document.createElementNS('http://www.w3.org/2000/svg', 'rect');
    rect.setAttributeNS(null, 'y', y);
    rect.setAttributeNS(null, 'x', x);
    rect.setAttributeNS(null, 'width', width);
    rect.setAttributeNS(null, 'height', height);
    rect.setAttributeNS(null, 'fill', buttonColor);
    rect.setAttributeNS(null, 'opacity', '1');
    rect.setAttributeNS(null, 'stroke', 'none');
    rect.setAttributeNS(null, 'rx', '5');
    
    x += 4;
    y += 16;
    var text = createTextNode(x, y, 'none', font, '16px', 'jump to');
     
    button.appendChild(rect);
    button.appendChild(text);
    
    return button;
}

