/*- activates the slider -*/
function sliderActivate(evt){
    if(sliderActive){
        return;
    }
    
    sliderBoundings = evt.target.parentNode.firstChild;
    thumb = evt.target.parentNode.childNodes[3];
    
    if(evt.target.parentNode.id == 'speedSlider.Thumb' || evt.target.parentNode.id == 'delaySlider.Thumb' || evt.target.parentNode.id == 'graphSlider.Thumb') {
        sliderBoundings = evt.target.parentNode.parentNode.firstChild;
        thumb = evt.target.parentNode.parentNode.childNodes[3];
    }
   
    sliderBoundings.addEventListener('mousemove', sliderMove, null);
    sliderActive = true;
    
    if(sliderBoundings.parentNode.id == 'speedSlider'){
        speedVal = true;
    }
    else if(sliderBoundings.parentNode.id == 'delaySlider'){
        delayVal = true;
    }
    else if(!run){
        graphVal = true;
    }
    else{
        sliderBoundings.removeEventListener('mousemove', sliderMove, null);
        sliderActive = false;
    }
}

/*----------------------------------------------------------------------------------*/

/*- deactivates the slider and changes speed or duration -*/
function sliderDeactivate(evt){
    if(sliderActive){
        sliderBoundings.removeEventListener('mousemove', sliderMove, null);
        sliderActive = false;
        var val;
        
        if(graphVal){
            if(thumbPosition % graphSliderStep < graphSliderStep/2){
                val = thumbPosition - (thumbPosition % graphSliderStep);
                var thumbMove = val+1;
                thumb.setAttributeNS(null, 'transform', 'translate('+thumbMove+',-10)');
            }
            else{
                val = thumbPosition + graphSliderStep - (thumbPosition % graphSliderStep);
                var thumbMove = val+1;
                thumb.setAttributeNS(null, 'transform', 'translate('+thumbMove+',-10)');
            }
            var targetGraph = val/graphSliderStep;
            if(sourceNo != targetGraph){
                jumpToGraph(targetGraph);
            } 
            graphVal = false;
            return;
        }
        
        if(thumbPosition % 10 < 5){
            val = thumbPosition - (thumbPosition % 10);
            var thumbMove = val+1;
            thumb.setAttributeNS(null, 'transform', 'translate('+thumbMove+',0)');
            
        }
        else{
            val = thumbPosition + 10 - (thumbPosition % 10);
            var thumbMove = val+1;
            thumb.setAttributeNS(null, 'transform', 'translate('+thumbMove+',0)');
        }
        
        if(speedVal){
            val = val/10;
            switch(val){
                case 0:
                    slideDuration = 5;
                    break;
                case 1:
                    slideDuration = 4.5;
                    break;
                case 2:
                    slideDuration = 4;
                    break;
                case 3:
                    slideDuration = 3.5;
                    break;
                case 4:
                    slideDuration = 3;
                    break;
                case 5:
                    slideDuration = 2.5;
                    break;
                case 6:
                    slideDuration = 2.25;
                    break;
                case 7:
                    slideDuration = 2;
                    break;
                case 8:
                    slideDuration = 1.75;
                    break;
                case 9:
                    slideDuration = 1.5;
                    break;
                case 10:
                    slideDuration = 1.25;
                    break;
                case 11:
                    slideDuration = 1;
                    break;
                case 12:
                    slideDuration = 0.75;
                    break;
                case 13:
                    slideDuration = 0.5;
                    break;
                case 14:
                    slideDuration = 0;
                    break;
                default:
                    slideDuration = 2;
            }
            
            speedVal = false;
        }
        else{
            val = val/10;
            switch(val){
                case 0:
                    slideDelay = 0;
                    break;
                case 1:
                    slideDelay = 0.5;
                    break;
                case 2:
                    slideDelay = 1;
                    break;
                case 3:
                    slideDelay = 1.5;
                    break;
                case 4:
                    slideDelay = 2;
                    break;
                case 5:
                    slideDelay = 2.5;
                    break;
                case 6:
                    slideDelay = 3;
                    break;
                case 7:
                    slideDelay = 3.5;
                    break;
                case 8:
                    slideDelay = 4;
                    break;
                case 9:
                    slideDelay = 4.5;
                    break;
                case 10:
                    slideDelay = 5;
                    break;
                case 11:
                    slideDelay = 5.5;
                    break;
                case 12:
                    slideDelay = 6;
                    break;
                case 13:
                    slideDelay = 6.5;
                    break;
                case 14:
                    slideDelay = 7;
                    break;
                default:
                    slideDelay = 0;
            }
            slideBeginElementDelay = slideDelay;
            delayVal = false;
        }
        
    } 
}

/*----------------------------------------------------------------------------------*/

/*- moves slider -*/
function sliderMove(evt){
    var slider = evt.target.parentNode;
    var val = evt.clientX - parseFloat(slider.getAttributeNS(null, 'xoffset'));
    if(val >= 0 && val <= 140){
        if(graphVal){
            thumb.setAttributeNS(null, 'transform', 'translate('+val+',-10)');
        }
        else{
            thumb.setAttributeNS(null, 'transform', 'translate('+val+',0)');
        }
        thumbPosition = val;
    }
}

