function uncheckHighlighting(evt){
    var cross = document.getElementById('highlightingCross');
    
    if(highlight){
        cross.setAttributeNS(null, 'opacity', '0');
        highlight = false;
    }
    else{
        cross.setAttributeNS(null, 'opacity', '1');
        highlight = true;
    }
}

