function uncheckLoop(evt){
	var loopCross = document.getElementById('loopCross');
	
	if(loop){
		loopCross.setAttributeNS(null, 'opacity', '0');
		loop = false;
	}
	else{
		loopCross.setAttributeNS(null, 'opacity', '1');
		loop = true;
	}
}

