function checkForSupport(){
    if(supportChecked){
        return;
    }
    else{
        if(!document.implementation.hasFeature("TimeControl", "1.1")){
            alert('It seems that your browser doesn\'t support SVG-Animations');
        }
        supportChecked = true;
    }
}
